In the early September, we are celebrating CUSTOMER APPRECIATION DAY. Tahu apa saja yang berhak diperoleh konsumen? Ini dia :
1.Memperoleh kenyamanan, keamanan, dan keselamatan dalam mengkonsumsi barang dan/atau jasa;
2. Memilih barang dan/atau jasa dengan nilai tukar dan kondisi serta jaminan yang dijanjikan;
3. Memperoleh informasi yang benar, jelas, dan jujur mengenai kondisi dan jaminan barang dan/atau jasa;
4.Didengar pendapat dan keluhannya atas barang dan/atau jasa yang digunakan;
5. Mendapatkan advokasi, perlindungan, dan upaya penyelesaian sengketa perlindungan konsumen secara patut;
6. Diperlakukan atau dilayani secara benar dan jujur serta tidak diskriminatif;
7. Mendapatkan kompensasi, ganti rugi dan/atau penggantian, apabila barang dan/atau jasa yang diterima tidak sesuai dengan perjanjian atau tidak sebagaimana mestinya

